  const renderPage = () => {
    switch(currentPage) {
      case "About me":
        return <About />;
      default: 
        return <About />;
    }
  };

  return (
    <div>
      <Header currentPage={currentPage} />
      {renderPage()}

    </div>

  );
}


export default App;
